import React from "react"; 
import {Btn, Container,HeadTitle,Titlecontainer} from './style'

class Buttons extends React.Component{
      render(){
        return(
            <Container>
                <Titlecontainer>
             <HeadTitle>Login</HeadTitle>
             <HeadTitle>Register</HeadTitle>
              </Titlecontainer>           

               <Btn>Login</Btn>
               <Btn>Register</Btn>

            </Container>
        )
      }
}
export default Buttons
